func makeTheIntegerZero(num1 int, num2 int) int {
    if num2 == 0 {
        return -1
    }
    operations := 0
    for num1 != 0 {
        if num1 < 0 && num2 > 0 || num1 > 0 && num2 < 0 {
            return -1
        }
        found := false
        for i := 60; i >= 0; i-- {
            pow := 1 << i
            if (num2 > 0 && num1-pow >= 0) || (num2 < 0 && num1+pow <= 0) {
                num1 -= pow + num2
                operations++
                found = true
                break
            }
        }
        if !found {
            return -1
        }
    }
    return operations
}
